import React from 'react';


import { Row, Col } from "react-bootstrap";
import './section2.css';

import EIC from './Exchange_Info_card_left';


const Section2 = () => {
    return (
      <div className="container salign-middle mt-5">
        <Row>
          <Col xs={12} md={4}>
            <EIC />
          </Col>
          <Col xs={12} md={4}>
            <EIC />
          </Col>
          <Col xs={12} md={4}>
            <EIC />
          </Col>
        </Row>
      </div>
    );
}

export default Section2
